import React from 'react';

let name = 'Josh';
let lName = 'Cutcher';
let age = Math.floor(Math.random() * 100);
let gender = [
    'male',
    'female'
];
let rndGender = Math.floor(Math.random() * 3);


const person = () => {
    return <h1>Hello, I'm {name} {lName} and I'm {age} year-old-{gender[rndGender]}.</h1>
}

export default person;
